import React from 'react';
import MenuElement from './MenuElement.js';

import './LeftMenu.css';

const LeftMenu = () => {
  let elementList;
  for (let i = 0 ; i < 50 ; i ++) {
    const Text = "Element " + i;

    elementList += <MenuElement val={Text} src="placeholder.jpg"/>
  }


  return (
    <div className="menu left">
      <div className="banner">
        Menu
      </div>
      <div className="elements">
        <MenuElement val="Element 1" src="placeholder.jpg"/>
        <MenuElement val="Element 3" src="placeholder2.jpg"/>
        <MenuElement val="Element 2" src="placeholder.jpg"/>
        <MenuElement val="Element 4" src="placeholder2.jpg"/>
      </div>
    </div>
  )
}

export default LeftMenu;
